{% block title %}Libro index{% endblock %}

{% block body %}
    <h1>Libro index</h1>

    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Titulo</th>
                <th>Isbn</th>
                <th>Fecha</th>
                <th>Genero</th>
                <th>Bestseller</th>
                <th>Image</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for libro in libros %}
            <tr>
                <td>{{ libro.id }}</td>
                <td>{{ libro.titulo }}</td>
                <td>{{ libro.isbn }}</td>
                <td>{{ libro.fecha ? libro.fecha|date('Y-m-d') : '' }}</td>
                <td>{{ libro.genero }}</td>
                <td>{{ libro.bestseller ? 'Yes' : 'No' }}</td>
                <td>{{ libro.image }}</td>
                <td>
                    <a href=\"{{ path('libro_show', {'id': libro.id}) }}\">show</a>
                    <a href=\"{{ path('libro_edit', {'id': libro.id}) }}\">edit</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"8\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>

    <a href=\"{{ path('libro_new') }}\">Create new</a>
{% endblock %}
